"use strict";
eval("module.exports = \"## Welcome\\n\\nWitaj w demo nowego edytora!\\n\\nTo krtkie demo prezentujce moliwoci nowego edytora, ktry prawdopodobnie wkrtce bdzie uywany na [4programmers.net](https://4programmers.net).\\n\\nEdytor prezentuje nowatorski WYSWIG - dodaje formatowanie do markdownu, ale nigdy nie ukrywa adnych znakw, wic zawsze widzisz, co wpisae.\\n\\n### Typografia\\n\\nEdytor wspiera markdownowe **pogrubienie** tekstu, markdownowe *pochylenie* tekstu, oraz markdownowe ~~przekrelenie~~ tekstu (a'la Github-Flavoured Markdown). W Markdown, uywanie znaku `_` podkrelnika jest rwnowane z `*`, wic to jest __pogrubienie__, a to _pochylenie_.\\n\\nWspierane jest rwnie zagniedenie *rnych **stylw ~~w ramach~~ jednego** napisu*.\\n\\nBy podkreli tekst w 4programmers.net, uyj HTML: <u>podkrelenie</u>. Wspierane jest rwnie <b>pogrubienie</b> oraz <i>pochylenie</i> znacznikami HTML.\\n\\nEdytor dekoruje rwnie `inline code`, czyli krtkie kawaki tekstu, ktre maj reprezentowa elementy jzyka programowania, np. \\\"Dodaj `console.log(user)`\\\". By umieci znak \\\"back-tick\\\", uyj zapisu ``Zagniedone uycie ` backticka ``.\\n\\n#### Listy zachowujce oraz nie zachowujce kolejnoci\\n\\nEdytor dodaje wsparcie dla list (rwnie zanany jako wypunktowane i numerowane listy). Ustaw kursor przy dowolnym elemencie i wcinij <kbd>Enter</kbd>:\\n\\n1. Pierwszy element\\n2. Ustaw kursor na linii i kliknij enter:\\n3. Ostatni element\\n\\nMajc kursor na elemencie listy, wcinij <kbd>Tab</kbd>, by wci element listy.\\n\\n#### Podtekst oraz supertekst\\n\\nBy doda podtekst lub supertekst uyj tagw `<sub>` oraz `<sup>`:\\n\\n- Podtekst: Wzr chemiczny wody to H<sub>2</sub>O\\n- Supertekst: e<sup>  i</sup> = -1\\n\\n### Cytat\\n\\n> > ##### [Silv napisa(a)](/Forum/1794731):\\n> Dla rwnowagi opinii  ja nie widz wikszej rnicy. Tak samo chtnie zobacz propozycj.\\n\\n### Podgld obrazw\\n\\nDodanie obrazu markdown, korzystajc ze skadni ![image](https://4programmers.net/img/logo-mobile.png) pokae podgld obrazu poniej paragrafu.\\n\\nObrazy nie s elementem edytora, s jedynie dekoracj. Nie wchodz w interakcj z mysz lub klawiatur, nie stanowi te osobnej linii.\\n\\n### Tabelki\\n\\nEdytor dekoruje tabelki - wiersze, komrki oraz nagwki. Dodaje rwnie czcionk `monospace`, co pozwoli lepiej dostrzec jej ksztat.\\n\\n| Scientist       | Nationality |\\n| --------------- | ----------- |\\n| Albert Einstein | German      |\\n\\nTableki rwnie respektuj style wewntrz komrek, take z **pogrubieniem**, *pochyleniem*, `inline-code` oraz wszystkimi innymi *inline* elementami, takimi jak linki.\\n\\n| Algorithm       | Description            |\\n| --------------- | ---------------------- |\\n| **Quick** sort  | zoono `O(n log n)` |\\n| Bubble *sort*   | zoono `O(n^2)`     |\\n\\nTabelki jednak nie respektuj blokowych elementw, wic nie mona osadzi blokowego fragmentu kodu w tabelce. Obrazki nie s elementami blokowymi, wic mona je umieszcza w tabelce.\\n\\n### Przykady kodu\\n\\nW edytorze moesz osadzi fragmenty kodu.\\n\\nPrzykadowy skrypt powoki:\\n```sh\\n#!/bin/bash\\nvar=\\\"Hello World\\\"\\nprintf \\\"%s\\\\n\\\" \\\"$var\\\"\\n```\\n\\nPrzykadowy Dockerfile:\\n\\n```Dockerfile\\nFROM ubuntu:18.04\\nCOPY ../demo /app\\nCMD python /app/app.py\\n```\\n\\n#### Auto-uzupenienie taga kodu\\n\\nUstaw kursor za `js` i wcinij <kbd>Backspace</kbd>, zobaczysz autocomplete, pomagajcy wybra odpowiedni tag dla odpowiedniego jzyka programowania.\\n\\n```js\\nconsole.log(\\\"welcome\\\");\\n```\\n\\nUywajc autocomplete, zmie `js` na `json` w przykadzie wyej.\\n\\n### Klawisze z klawiatury\\n\\nEdytor formatuje tag `<kbd></kbd>` jako kombinacj klawiszy. Dekoracja `<kbd></kbd>` jest dodawana kiedy wyraony klawisz ma konkretn posta:\\n\\nW ramach jednego skrtu oddziel klawisze plusem. Rne skrty oddziel od siebie przecinkiem. By doda klawisz `+`, `,`lub `-` - uyj `Plus`, `Comma` lub `Minus`.\\n\\n- Przewi stron w Chrome <kbd>PageDown</kbd>\\n- Wyszukaj plik na Macu <kbd>Command+F6</kbd>\\n- Zmie nazw w Visual Studio <kbd>Ctrl+K,Ctrl+R</kbd> lub <kbd>Shift+F6</kbd>\\n- Wprowad polecenie w Vim <kbd>:</kbd>, potem wyjd <kbd>Esc</kbd>, `\\\":wq!\\\"`, <kbd>Enter</kbd>\\n- Do powikszenia obrazu uyj skrtu <kbd>Ctrl+Plus</kbd> lub <kbd>Ctrl+Minus</kbd>\\n- <kbd>Ctrl+</kbd> znak diaryktyczny\\n- Skrt na Macu to <kbd>Ctrl+Comma</kbd>\\n\\nNiepoprawne klawisze zostan zinterpretowane jak zwyky kod HTML. Znaki diaryktyczne, biae znaki oraz blokowe elementy nie s formatowane.\\n\\n- <kbd >Shift</ kbd > inny format taga\\n- <kbd><kbd>Shift</kbd></kbd> - zewntrzne tagi s nie s dekorowane\\n\\nMona tworzy klikalne przyciski, czc `[link]` oraz `<kbd>klawisz</kbd>`\\n\\n- Kliknij w [<kbd>Enter</kbd>](http://4programmers.net)\\n\\n### Wspomnienia innych uytkownikw\\n\\nEdytor wspiera auto-uzupenienie wspomnie uytkownikw, do tego celu wstaw znak `@` oraz zacznij pisa nick uytkownika. Wspierane s rwnie nazwy uytkownikw zawierajce spacje i kropki.\\n\\n@someki\\n@Ad\\n@{To\\n@{s.text}\\n\\n### Specjalne linki Coyote\\n\\nSerwis 4programmers.net udostpnia krtk skadni dla zasobw wewntrz strony, np. do forum lub kompendium. Takie linki nie s zgodne z Markdown i maj inn skadnie, ale stanowi pewne uatwienie wewntrz samej strony.\\n\\n- Link do kompendium: [[Python]]\\n- Link do forum: [[Forum/Delphi]]\\n\\n### Wstawki HTML\\n\\nEdytor dekoruje wikszo elementw HTML.\\n\\nKomentarze: <!-- comment -->\\nEncje HTML: &nbsp; &gt;\\n\\nTagi HTML, poniewa HTML to poprawny Markdown:\\n\\n<div>\\n    <p>Paragraph</p>\\n</div>\\n\\nNiektre tagi HTML maj rwnie dodatkowe dekoracje\\n\\n<b>pogrubienie</b>, <i>pochylenie</i> oraz <u>podklrelenie</u>.\\n\";\n\n//# sourceURL=webpack:///./src/assets/source/initial.md?");

